tables.table_schema:
CREATE TABLE Organisms (
    organism_id INT PRIMARY KEY,
    organism_name VARCHAR(100),
    species_name VARCHAR(100),
    genetic_sequence TEXT
);

CREATE TABLE organism (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    species VARCHAR(255) NOT NULL
);

CREATE TABLE Organisms (
  organism_id INT PRIMARY KEY,
  organism_name VARCHAR(255) NOT NULL,
  organism_type VARCHAR(50) NOT NULL
);

CREATE TABLE Sequences (
  sequence_id INT PRIMARY KEY,
  organism_id INT,
  sequence_data TEXT NOT NULL,
  FOREIGN KEY (organism_id) REFERENCES Organisms(organism_id)
);

CREATE TABLE Researchers (
  researcher_id INT PRIMARY KEY,
  researcher_name VARCHAR(255) NOT NULL,
  researcher_email VARCHAR(255) UNIQUE
);

CREATE TABLE ResearchProjects (
  project_id INT PRIMARY KEY,
  project_name VARCHAR(255) NOT NULL,
  researcher_id INT,
  FOREIGN KEY (researcher_id) REFERENCES Researchers(researcher_id)
);
